messages.speech:
Вы можете выпустить карту в мобильном банкинге:
1. На главном экране «Продукты Банка», выберите «Платежная карта»;
2. Выберите  валюту счета;
3. Выберите платежную систему и тип карты;
4.Выберите способ получения – в отделении или доставку на дом;
5. При выборе курьерской доставки – укажите адрес доставки (стоимость доставки зависит от региона и будет списана с карты).
